function Table({spiral}) {
    <div className='row'>
    <div className='col'>
        <table className='table table-bordered'>
            <tbody>
                {spiral.map ((currentRow) =>(
                    <tr key={currentRow.toString()}>
                        {currentRow.map ((currentColumn) =>(
                            <td key={Math.random()}>{currentColumn}</td>
                        ))}
                    </tr>
                ))}         
            </tbody>
        </table>
    </div>
</div>
}

export default Table;
